import { v4 as uuid } from 'uuid'


export const todoList = [
    {
        id: uuid(),
        text: 'Learn JS',
        done: true,
    },
    {
        id: uuid(),
        text: 'Learn React',
        done: false,
    },
    {
        id: uuid(),
        text: 'Learn Redux',
        done: false,
    },
    {
        id: uuid(),
        text: 'Learn Routers',
        done: true,
    },
    {
        id: uuid(),
        text: 'Learn API',
        done: true,
    },
    {
        id: uuid(),
        text: 'Learn SW',
        done: false,
    },
    {
        id: uuid(),
        text: 'Learn TS',
        done: true,
    }
];
